import "./App.css";
import "./styles.css";
import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';

import NewListing from "./page/NewListing";
import PendingListing from "./page/PendingListing";
import CompletedListing from "./page/CompletedListing";
import Layout from "./page/Layout";
import FileStatusListingPage from "./page/FileStatusListingPage";
import TaskAddPage from "./page/TaskAddPage";

function App() {
  return (
    <Router>
      <Layout>
      <Routes >
        <Route path="/" element={<TaskAddPage/>}  />
        <Route path="/pending" element={<PendingListing/>} />
        <Route path="/completed" element={<CompletedListing/>} />
      </Routes >
      </Layout>
    </Router>
  );
}

export default App;
